import React from 'react';

const Year = (props) => {
    // console.log(props)
    return (
        <React.Fragment>
            {/* <br /> */}
            <button onClick={() => props.handleClick('year', props.year)}>
                {props.year}
            </button>
        </React.Fragment>
    )
}

export default Year;
